                    <h1 class="text-white mb-3 animated slideInDown">خرم گستر الکترونیک</h1>
                    <p class="text-white pb-3 animated slideInDown">
                     شرکت دانش بنیان خرم گستر الکترونیک فعال در زمینه تولید بردهای الکترونیکی با برترین کیفیت، ساخت انواع لامپهای الکترونیکی تیوپ و والو و سایر اجزاء الکترون، مجهز به مدرن ترين ماشين آلات انواع تجهيزات تمام مکانيزه و آزمايشگاه های کنترل و بازرسی مواد اوليه و محصول
                </p>
